import React from 'react';
import { Parallax } from 'react-scroll-parallax'
import './Header.scss'

function Header() {
    const text = 'Parallax'.split('');
    return (
        <div className="text-div">
            <span className="text-span">
                {text.map((letter, i) => (
                    <Parallax
                        key={`text-${i}`}
                        offsetXMax={100 * (i - 3)}
                        className="text"
                    >
                        {letter}
                    </Parallax>
                ))}
            </span>
        </div>
    );
}

export default Header;
